            switch (Label) {

                case "Class": return Goedel.Tool.Command.CommandParseType.Class;
                case "Library": return Goedel.Tool.Command.CommandParseType.Library;
                case "CommandSet": return Goedel.Tool.Command.CommandParseType.CommandSet;
